// SPDX-License-Identifier: AGPL-3.0

pragma solidity ^0.8.10;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Gate is Ownable {
    error SignatureInvalidV();

    struct Swap {
        address token;
        string recipient;
        address sender;
        uint256 amount;
        uint256 nonce;
        bytes signature;
    }

    event FundEvent(
        bytes32 indexed swapId,
        address token,
        string indexed recipient,
        address indexed sender,
        uint256 amount,
        uint256 nonce
    );

    event NewOracleEvent(address indexed oracle);
    event SwapSigned(
        bytes32 indexed swapId,
        bytes signature
    );

    address oracle;

    mapping(bytes32 => Swap) swaps;

    constructor() {}

    function fund(
        address token,
        string memory recipient,
        uint256 amount,
        uint256 nonce
    ) external returns (bytes32 swapId) {
        swapId = sha256(
            abi.encodePacked(token, recipient, _msgSender(), amount, nonce)
        );

        if (haveSwap(swapId)) revert("this swap already exists");

        if (!IERC20(token).transferFrom(_msgSender(), address(this), amount))
            revert("transferFrom sender to this failed");

        swaps[swapId] = Swap(token, recipient, _msgSender(), amount, nonce, "");

        emit FundEvent(swapId, token, recipient, _msgSender(), amount, nonce);
        return swapId;
    }

    function haveSwap(bytes32 swapId) internal view returns (bool exists) {
        exists = (swaps[swapId].sender != address(0));
    }

    function getSwap(bytes32 swapId)
        public
        view
        returns (
            bytes32 id,
            address token,
            string memory recipient,
            address sender,
            uint256 amount,
            uint256 nonce,
            bytes memory signature
        )
    {
        if (haveSwap(swapId) == false)
            return (0, address(0), "", address(0), 0, 0, "");

        Swap storage swap = swaps[swapId];

        return (
            swapId,
            swap.token,
            swap.recipient,
            swap.sender,
            swap.amount,
            swap.nonce,
            swap.signature
        );
    }

    function parseSignature(bytes memory _signature)
        internal
        pure
        returns (
            bytes32 r,
            bytes32 s,
            uint8 v
        )
    {
        assembly {
            r := mload(add(_signature, 32))
            s := mload(add(_signature, 64))
            v := and(mload(add(_signature, 65)), 0xff)
        }

        if (v < 27) v += 27;
        if (v != 27 && v != 28) revert SignatureInvalidV();
    }

    function sign(bytes32 swapId, bytes memory signature) external {
        (bytes32 r, bytes32 s, uint8 v) = parseSignature(signature);
        address signer = ecrecover(getUnsignedMsg(swapId), v, r, s);
        if (signer != oracle) {
            revert SignatureInvalidV();
        }
        swaps[swapId].signature = signature;
        emit SwapSigned(swapId, signature);
    }

    function getUnsignedMsg(bytes32 swapId) internal pure returns (bytes32) {
        return keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32", swapId));
    }

    function setOracle(address _oracle) external onlyOwner {
        oracle = _oracle;
        emit NewOracleEvent(oracle);
    }
}
